# base64二进制pdf 数据
pdf_b64 = b""

# watermark_base64b = b''

from PyPDF2 import PdfFileWriter, PdfFileReader
import io
import base64

watermark_f = r'K:\mashuaifei\门禁\水印.pdf'
# 编码PDF 水印文件为 -> base64 b
watermark_base64b = base64.standard_b64encode(open(watermark_f, 'rb').read())
print(watermark_base64b)


def _addWatermark(pdf_b64):
    # 获取数据库中的二进制文件为输入.
    # 解码数据为二进制 -> model b
    pdf_2 = base64.standard_b64decode(pdf_b64)
    pdf_watermark = base64.standard_b64decode(watermark_base64b)
    # 读取到pypdf2 -> pdfFR
    pdfFRmodel_b = PdfFileReader(io.BytesIO(pdf_2), strict=False)
    # 读取水印文件  -> pdfFR
    # pdfFR_watermark = PdfFileReader(open(watermark_f, mode='rb'), strict=False) # 单个文件
    pdfFR_watermark = PdfFileReader(io.BytesIO(pdf_watermark), strict=False)  # 读取base64 b 水印文件
    # 合并水印文件到pdf
    # 转换到 -> model b
    pdf_output = PdfFileWriter()  # 定义输出文件对象
    page_count = pdfFRmodel_b.getNumPages()  # 获得页面数量
    for page_number in range(page_count):
        input_page = pdfFRmodel_b.getPage(page_number)
        input_page.mergePage(pdfFR_watermark.getPage(0))
        pdf_output.addPage(input_page)
    stream = io.BytesIO()
    pdf_output.write(stream)
    data = base64.standard_b64encode(stream.getvalue())  # 转换为model b
    return data


_addWatermark(pdf_b64)
